import React from 'react'
import Header from '../../components/header/header'    
import {default as Projects} from '../../pages/projects/projects'    
import "./home.css";

import Carousel from 'react-bootstrap/Carousel';

const Home = () => {
  return (
    <div className='home'>
      <Header></Header>
      <hr></hr>
      <Carousel>
        <Carousel.Item>
          <Projects></Projects>
        </Carousel.Item>
        {/* Add more Carousel.Items for additional projects */}
      </Carousel>
    </div>
  )
}

export default Home
